import React from "react";

const PokemonItem = (props) => {
  return (
    <div className="container">
      <div className="row">
        {props.items.map((p, i) => {
          return (
            <div className="col-md-3" key={i}>
              {p}
            </div>
          );
        })}
      </div>
    </div>
  );
};
export default PokemonItem;
